@import "modules/variables";
.header__inner .logo-img {
  // filter: invert(1);
  filter: brightness(0.5) invert(1);
  transition: all 1s;
  // -webkit-transition: -webkit-filter 5s linear;
}
#container {
  opacity: 0;
  visibility: hidden;
  transition: 1s;
}
.pace-done {
  .header__inner .buttons {
    opacity: 1;
    visibility: visible;
  }
  .header__inner .logo-img {
    // filter: invert(0);
    filter: none;
  }
  #loading-container {
    opacity: 0;
    visibility: hidden;
  }
  #container {
    opacity: 1;
    visibility: visible;
  }
}
#loading-container {
  position: absolute;
  width: 100%;
  height: 100vh;
  display: flex;
  justify-content: center;
  align-items: center;
  opacity: 0.9;
  background-color: $black;
  -webkit-box-reflect: below 1px linear-gradient(#0001, #0004);
  transition: 1s;

  .loader {
    position: relative;
    width: 200px;
    height: 200px;
    border-radius: 50%;
    // background-color: $black;
    animation: loader 2s linear infinite;

    &::before {
      content: "";
      position: absolute;
      top: 0;
      left: 0;
      width: 50%;
      height: 100%;
      background: linear-gradient(to top, transparent, rgba($orange, 0.4));
      background-repeat: no-repeat;
      border-top-left-radius: 100px;
      border-bottom-left-radius: 100px;
    }
    &::after {
      content: "";
      position: absolute;
      z-index: 10;
      top: 0;
      left: 50%;
      transform: translateX(-50%);
      width: 20px;
      height: 20px;
      background: $orange;
      border-radius: 50%;
      box-shadow: 0 0 10px $orange, 0 0 20px $orange, 0 0 30px $orange,
        0 0 40px $orange, 0 0 50px $orange, 0 0 60px $orange, 0 0 70px $orange,
        0 0 80px $orange, 0 0 90px $orange, 0 0 100px $orange;
    }

    span {
      position: absolute;
      top: 20px;
      bottom: 20px;
      left: 20px;
      right: 20px;
      background-color: $black;
      border-radius: 50%;
    }
  }
}

@keyframes loader {
  0% {
    transform: rotate(0deg);
  }
  40% {
    transform: rotate(180deg);
  }
  100% {
    transform: rotate(360deg);
  }
}
